import React, { useState, useEffect } from 'react';
import './SurveyCard.css';
import { Accordion, AccordionSummary, AccordionDetails} from '@material-ui/core';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';


function SurveyCard(props:any) {
  const { survey } = props;

  console.log(survey);

  return (
      <Accordion >
        <AccordionSummary
          expandIcon={<ExpandMoreIcon />}
          aria-controls="panel1a-content"
          id="panel1a-header"
          className="survey"
        >
          <p><i>{survey.timeStamp}</i></p>
          <p>Building: {survey.buildingNumber}, Room: {survey.roomNumber}</p>
        </AccordionSummary>
        <AccordionDetails>
          <p>Room Temp: {survey.thermalSensation}</p>
          <p>Temp Preference: {survey.thermalPreference}</p>
          <p>Air <Circulation></Circulation>: {survey.thermalSensation}</p>
        </AccordionDetails>
    </Accordion>
  )
};

export default SurveyCard
